import React from 'react';
import PythonIcon from '../../assets/img/python_vertical_logo_icon_168039.svg';
import DjangoIcon from '../../assets/img/file_type_django_icon_130645.svg';
import ReactIcon from '../../assets/img/react_original_wordmark_logo_icon_146375.svg';
import CssIcon from '../../assets/img/file_type_css_icon_130661.svg';
import DockerIcon from '../../assets/img/docker_original_wordmark_logo_icon_146557.svg';
import JsIcon from '../../assets/img/javascript_icon_130900.svg';
import SkilItem from './SkilItem';

const items = [
  {
    id: 1,
    display: 'Python',
    image: PythonIcon,
  },
  {
    id: 2,
    display: 'Django',
    image: DjangoIcon,
  },
  {
    id: 3,
    display: 'JavaScript',
    image: JsIcon,
  },
  {
    id: 4,
    display: 'React',
    image: ReactIcon,
  },
  {
    id: 5,
    display: 'CSS',
    image: CssIcon,
  },
  {
    id: 6,
    display: 'Docker',
    image: DockerIcon,
  },
];

const Skills = () => {
  return (
    <div className='skills'>
      <div className='container'>
        <h1>./Skills</h1>
        <div className='skills-items'>
          {items.map((item) => (
            <SkilItem key={item.id} item={item} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Skills;
